def asc_desc_ending_sort(n, m, string_list):
    def compare_strings(a, b):
        for i in range(m):
            if i % 2 == 0:
                if a[i] > b[i]:
                    return 1
                elif a[i] < b[i]:
                    return -1
            else:
                if a[i] < b[i]:
                    return 1
                elif a[i] > b[i]:
                    return -1
        return 0

    indices = [i+1 for i in range(n)]
    indices.sort(key=lambda x: compare_strings(string_list[x-1], string_list[x]))

    return indices
